import React from "react";
import PropTypes from "prop-types";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Tabs from "@material-ui/core/Tabs";
import Tab from "@material-ui/core/Tab";
import Typography from "@material-ui/core/Typography";
import Box from "@material-ui/core/Box";
import PlaCard from "./Card";
import Demo from "./ChatBot/bot";
import PeopleCard from "./ActionComponents/People/PeopleCard";
import SportsCard from "./ActionComponents/sports/SportsCard";
import PlacesCard from "./ActionComponents/places/PlacesCard";

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    "aria-controls": `simple-tabpanel-${index}`,
  };
}

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper,
  },
}));

export default function SimpleTabs() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);
  let allyCount = 0;
  let indexCount = 0;

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div className={classes.root}>
      <AppBar position="static">
        <Tabs
          value={value}
          onChange={handleChange}
          aria-label="simple tabs example"
        >
          <Tab label="People" {...a11yProps(allyCount++)} />
          <Tab label="Sports" {...a11yProps(allyCount++)} />
          <Tab label="Places" {...a11yProps(allyCount++)} />
          <Tab label="Item Two" {...a11yProps(allyCount++)} />
          <Tab label="Item Two" {...a11yProps(allyCount++)} />
        </Tabs>
      </AppBar>
      <TabPanel value={value} index={indexCount++}>
        <PeopleCard />
      </TabPanel>
      <TabPanel value={value} index={indexCount++}>
        <SportsCard />
      </TabPanel>
      <TabPanel value={value} index={indexCount++}>
        <PlacesCard />
      </TabPanel>
      <TabPanel value={value} index={indexCount++}>
        <Demo />
      </TabPanel>
      <TabPanel value={value} index={indexCount++}>
        <PlaCard />
      </TabPanel>
    </div>
  );
}
